endapat pengesahan Menteri Keuangan Nomor KEP102/KM.10/2008 tanggal 29 Mei 2008, diumumkan dalam Berita Negara Republik Indonesia tanggal 17 Juni 2008 Nomor 49 dan Tambahan Nomor 14.</p></div></div></div></section><div class="uk-margin-large-bottom"></div>'
